import{_ as i,o as a,c as s,b as e,d as r,e as t,a as o,r as c}from"./app.242423f0.js";var h="/aktivitaeten/DA-0244-2022-08-28/IMG_20220828_133115.jpg",d="/aktivitaeten/DA-0244-2022-08-28/IMG_20220828_133817.jpg",u="/aktivitaeten/DA-0244-2022-08-28/IMG_20220828_155111.jpg",m="/aktivitaeten/DA-0244-2022-08-28/IMG_20220828_133705.jpg",l="/aktivitaeten/DA-0244-2022-08-28/IMG_20220828_164955.jpg",p="/aktivitaeten/DA-0244-2022-08-28/IMG_20220828_165153.jpg";const g={},_=e("h1",{id:"aktivierung-von-da-0244",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#aktivierung-von-da-0244","aria-hidden":"true"},"#"),t(" Aktivierung von DA-0244")],-1),f={href:"https://www.qrz.com/db/DF9HC",target:"_blank",rel:"noopener noreferrer"},k=t("DF9HC"),b=t(" berichtet:"),z=t('Sonntag, sch\xF6nes Wetter und Zeit - also auf in den Park. Erst ein paar Tage vorher wurde schnell und unkompliziert "mein" neuer Park als POTA-Referenz eingetragen: die Rostocker Heide, Deutschlands gr\xF6\xDFter K\xFCstenwald, Parkreferenz '),v={href:"https://pota.app/#/park/DA-0244",target:"_blank",rel:"noopener noreferrer"},A=t("DA-0244"),w=t(" 9-EUR-Ticket galt noch, also mit S-Bahn, F\xE4hre und Bus auf den Weg gemacht. Im Gep\xE4ck mein FT-817, HF-P1 Antenne und zus\xE4tzlich ein 5,6m Teleskop f\xFCr 20m und h\xF6her."),D=o('<p><img src="'+h+'" alt="Auf dem Weg in den Park"></p><p>Da ich zus\xE4tzlich zu POTA auch WWFF machen wollte musste ich mich erst mal ins Naturschutzgebiet begeben. Hab dann meinen ersten Standort auf einer D\xFCne in Strandn\xE4he aufgeschlagen. Super Ausblick auf die Ostsee auf der einen Seite und Moor und See auf der anderen.</p><p><img src="'+d+'" alt="Naturschutzgebiet"></p><p>Zuerst hab ich 40m probiert, starke Signale zu h\xF6ren aber mich hat niemand geh\xF6rt. Es war schwierig eine freie Frequenz zu finden, st\xE4ndig wurde ich von st\xE4rkeren Stationen weggedr\xFCckt. Also mal 20m Meter probieren.</p><p><img src="'+u+'" alt="QRV auf der Bank"></p><p>Ich hatte nicht mit dem Wind gerechnet, oben auf der D\xFCne blies eine steife Briese die meine 5m hohe Antenne immer wieder umkippte. Also auf den Weg gemacht und einen ruhigeren Standort gesucht und auch gefunden: dort gab&#39;s sogar B\xE4nke zum Hinsetzen auf einer Plattform im Moor. Aber selbst dort setzte mir der Wind ziemlich zu. Antenne stand fest aber Kleinteile wie Kugelschreiber oder Klemmbrett mit Logzettel wurden immer wieder weggeweht.</p><p>Und ein weiteres Problem war, dass es kein Internet gab. Wie sollte ich mich jetzt spotten?</p><p><img src="'+m+'" alt="Naturschutzgebiet"></p><p>Mit etwas Geduld ging es dann mehr schlecht als recht, ich machte meine 10 QSOs auf 20m. Aus Neugier dann noch mal 15m probiert, da lief irgend ein brasilianischer Contest und ich konnte so sogar noch eine DX-Station ins Log kriegen, mit 5 W SSB.</p><p>Irgendwann kamen die M\xFCcken und ich machte mich auf den R\xFCckweg. Park war aktiviert und ich zufrieden. Da fahr ich bestimmt mal wieder hin. 73</p><p><img src="'+l+'" alt="Kreuzfahrtschiff"></p><p><img src="'+p+'" alt="Lotsenboot"></p><p>Ach auf dem R\xFCckweg kreuzte noch ein fettes Kreuzfahrtschiff meinen Weg.</p><h2 id="equipment" tabindex="-1"><a class="header-anchor" href="#equipment" aria-hidden="true">#</a> Equipment</h2><ul><li>Yaesu FT-817</li><li>Antenne HF-P1</li></ul>',15);function S(I,M){const n=c("ExternalLinkIcon");return a(),s("div",null,[_,e("p",null,[e("a",f,[k,r(n)]),b]),e("p",null,[z,e("a",v,[A,r(n)]),w]),D])}var W=i(g,[["render",S],["__file","2022-08-28-DA-0244.html.vue"]]);export{W as default};
